import React from 'react'

const cameraLayout = () => {

    let cameraFlexLayout = {
        dispay: 'flex',
        overflow: 'scroll',
        width: '100%',
        height: '100%'
    }

    let videoStyle = {
        width: '40%',
        height: '200px'
    }

    return(
    <div>
        <h1>Camera Layout</h1>
        <div style = {cameraFlexLayout}>
            <video controls autoplay src="../../../assets/testVids/carsTest.mp4" style = {videoStyle}></video>
        </div>
    </div>
    )
}

export default cameraLayout
